const tooltip = document.getElementById('tooltip');

canvas.addEventListener('mousemove', function(event) {

    const fractionAcross = (mouseX - marginLeft) / plotWidth;

    tooltip.style.opacity = 1;
} else {
    tooltip.style.opacity = 0;
}
});
